import React, { useState } from "react";
import axios from "axios";
import './App.css';

const CreateBlock = () => {
  const [thisBlock, setThisBlock] = useState("");
  const [nextBlock, setNextBlock] = useState("");

  const onSubmit = async (event) => {
    event.preventDefault();
    await axios.post("/block/create", {
      thisBlock : thisBlock,
      nextBlock : nextBlock
    });
    setThisBlock("");
    setNextBlock("");
  }

  console.log("Response" + onSubmit.data);

    return (
      <div classname = "App">
        <head className="App-header"> 
        <link rel="stylesheet" href="App.css"/>
          BlockChain Application 
          </head>
        <body className="App-header">
            <h1 class = "Heading">Trojan's BlockChain</h1>
            <hr></hr>
            <div className="App-intro">
              <form onSubmit={ onSubmit }>
                <label>This block</label>
                <br></br>
                <br></br>
                <input
                  value = { thisBlock }
                  onChange={(e) => setThisBlock(e.target.value)}
                  class="form-control"/>
                  <br></br>
                  <br></br>
                  <label>Next block</label>
                <br></br>
                <br></br>
                <input
                  value = { nextBlock }
                  onChange={(e) => setNextBlock(e.target.value)}
                  class="form-control"/>
                  <br></br>
                  <br></br>
                  <button class="btn">Submit</button>
              </form>
            </div>
        </body>
        </div>
    );
};

export default CreateBlock;
